import React from 'react';

import { Container } from 'react-bootstrap';

class Books extends React.Component{
    constructor(props){
        super(props);
        this.state = {
       books: [
            {
                id: 0,
                title: 'arthur'
            },
            {
                id: 1,
                title: 'sam'
            }
        ]
    }
    }
    test = this.state.books.map((books)=> <h1 key={books.id}>{books.title}</h1>)
    render(){
        return(
            <Container>
                {this.test}
            </Container>
        );
    }
}

export default Books;
